    if (index === 0 || index % 2 === 0) {
      return "white";
    } else {
      return "tan";
    }
  };

  const firstColumn = () => {
    if (Unit6Letter) {
      return Unit6Letter.map((item, index) => {
        return (
          <React.Fragment key={index}>
            <div className={`info-row icons gloss ${stripes(index)}`}>
              <p className="icon-input"> </p>
            </div>
          </React.Fragment>
        );
      });
